api_arguments.description:
The query that defines the objects to be returned. The Query object can contain a maximum of ten selectors. The conditions in the query are limited to top-level String fields in the object. These filters can be applied to components, instances, and attempts.
selectors -> (list)

List of selectors that define the query. An object must satisfy all of the selectors to match the query.
(structure)

A comparision that is used to determine whether a query should return this object.
fieldName -> (string)

The name of the field that the operator will be applied to. The field name is the âkeyâ portion of the field definition in the pipeline definition syntax that is used by the AWS Data Pipeline API. If the field is not set on the object, the condition fails.
operator -> (structure)

Contains a logical operation for comparing the value of a field with a specified value.
type -> (string)

The logical operation to be performed: equal (EQ ), equal reference (REF_EQ ), less than or equal (LE ), greater than or equal (GE ), or between (BETWEEN ). Equal reference (REF_EQ ) can be used only with reference fields. The other comparison types can be used only with String fields. The comparison types you can use apply only to certain object fields, as detailed below.
The comparison operators EQ and REF_EQ act on the following fields:

name
@sphere
parent
@componentParent
@instanceParent
@status
@scheduledStartTime
@scheduledEndTime
@actualStartTime
@actualEndTime

The comparison operators GE , LE , and BETWEEN act on the following fields:

@scheduledStartTime
@scheduledEndTime
@actualStartTime
@actualEndTime

Note that fields beginning with the at sign (@) are read-only and set by the web service. When you name fields, you should choose names containing only alpha-numeric values, as symbols may be reserved by AWS Data Pipeline. User-defined fields that you add to a pipeline should prefix their name with the string âmyâ.

values -> (list)

The value that the actual field value will be compared with.
(string)

